Cooler Master MasterCase 5 Mid-Tower Case with FreeForm Modular System, Window Side Panel

&nbsp;

MasterCase 5 The MasterCase represents the crest of a new wave of case technology, pioneering our unique FreeForm™ Modular System, which allows you to expand your case by replacing exterior elements, including top panels and the case door, as well as offering unparalleled flexibility to reconfigure the case interior.
